import React from 'react'
import Tour from './Tour'

function Tours() {
  return (
    <div>
        <Tour city={"Tanger City"} image={"./images/tanger.jpg"} price={"500$"}/>
        <Tour city={"Chefchaoun"} image={"./images/chaoun.jpg"} price={"350$"}/>
    </div>
  )
}



export default  Tours
